import React, { Component } from 'react';
import '../css/app.css';
import JumbotronCmp from './landing/Jumbotron';
import Cards from './landing/Cards';
import PhotoGallery from './landing/PhotoGallery';

class Landing extends Component {
	render() {
		return (
			<div id="main">
				<div id="content">
					<section>
						<div className="container">
							<JumbotronCmp />
						</div>
					</section>
					<section className="color">
						<div className="container">
							<Cards />
						</div>
					</section>
					<section>
						<div className="container">
							<PhotoGallery />
							<div> text text text</div>
						</div>
					</section>
				</div>
			</div>
		);
	}
}

export default Landing;
